import React from 'react';
import { Button } from 'react-bootstrap';

class Welcome extends React.Component{
    render(){
        return(
            <section>
                <h1>Welcome Section</h1>
                <Button variant="primary">Primary</Button>
            </section>
        )
    }
}
export default Welcome;
